import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';
import LoginScreen from './pages/LoginScreen';
import SignupScreen from './pages/SignupScreen';

function App() {
  return (
    <Router>
      <Route exact path={"/"}>
        <LoginScreen />
      </Route>
      <Route exact path={"/signup"}>
        <SignupScreen />
      </Route>
    </Router>
  );
}

export default App;
